                            {
                                description: "Spotify",
                                proName: "NYSE:SPOT",
                            },
                            {
                                description: "VMware",
                                proName: "NYSE:VMW",
                            },
                            {
                                description: "Door Dash",
                                proName: "NYSE:DASH",
                            },
                            {
                                description: "Waste Management",
                                proName: "NYSE:WM",
