            <div className="navbar">
                <a>Charts</a>
                <a>News</a>
                <a>History</a>
                <a>Trade</a>
                <a>Analysis</a>
            </div>
            <div className="chart">
                <SymbolOverview
                    widgetProps={{
                        isTransparent: true,
                        width: "100%",
                        height: "100%",
                        symbols: [
                            ["SPY", "AMEX:SPY|12M"],
